variable.CMO = variable.CMO || 0

function calculateSMA(values, periods) {
    if (values.length < periods) { return 0 }

    let sum = 0
    for (let i = values.length - periods; i < values.length; i++) {
        sum = sum + values[i]
    }
    let sma = sum / periods
    return sma
}

